import React from 'react';
import PropTypes from 'prop-types';
import HOC from "../../components/HOCImagePort/HOCImagePort"

const ImagePort = (props) => (

    <img  
        src={props.src}
        width = {props.width}
        height = {props.height}  
    />
);

ImagePort.defaultProps = {
  width: '100%',
  height: '100%',
  isScalable : false
};

export default HOC(ImagePort);
